import './App.css';

const Person = (props) =>{
  return(
    <>
      <h1>Name: {props.name}</h1>
      <h2>Last Name: {props.lastName}</h2>
      <h2>Age: {props.age}</h2>
    </>
  )
}

const App = () => {

  return (
    <div className="App">
      <Person name={'John'} lastName={'Doe'} age={25}/>
      <Person 
        name="Jane" 
        lastName='Doe' 
        age={2 + 2}
      />
      <Person name={'Mary'} lastName={'Doe'} age={24}/>
    </div>
  );
}

export default App;
